CREATE TABLE `medical_statistics_2` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `treatment_date` varchar(20) NOT NULL,
  `chart_number` varchar(20) NOT NULL,
  `name` varchar(50) NOT NULL,
  `insurance_classification` varchar(50) NOT NULL,
  `income_aggregation` varchar(50) NOT NULL,
  `treating_doctor` varchar(50) NOT NULL,
  `assist` varchar(50) NOT NULL,
  `same_day_reception` varchar(20) NOT NULL,
  `recipient` varchar(50) NOT NULL,
  `total_medical_expenses` decimal(10,2) DEFAULT NULL,
