  `non_salary` decimal(10,2) DEFAULT NULL,
  `vat` decimal(10,2) DEFAULT NULL,
  `discount_amount` decimal(10,2) DEFAULT NULL,
  `total_amount_received` decimal(10,2) DEFAULT NULL,
  `card_storage` decimal(10,2) DEFAULT NULL,
  `cash_receipt` decimal(10,2) DEFAULT NULL,
  `other_online` decimal(10,2) DEFAULT NULL,
  `prefectural_issued_amount` decimal(10,2) DEFAULT NULL,
  `disapproval_for_healthy_lifestyle` decimal(10,2) DEFAULT NULL,
  `unexpected_player` decimal(10,2) DEFAULT NULL,
  `total_number_of_outstanding_players` decimal(10,2) DEFAULT NULL,
  `classification_of_medical_expenses` varchar(50) DEFAULT NULL,
  `medical_history` longtext,
  `memo` longtext,
  `first_visit` varchar(20) DEFAULT NULL,
  `visit_path` varchar(50) DEFAULT NULL,
  `customer_propensity` varchar(50) DEFAULT NULL,
  `customer_classification` varchar(50) DEFAULT NULL,
  `customer_classification_2` varchar(50) DEFAULT NULL,
  `recall_classification` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `medical_statistics_2_treatment_date_chart_number_8c81a98d_uniq` (`treatment_date`,`chart_number`)
) ENGINE=InnoDB AUTO_INCREMENT=6278 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
